// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ServiceSelectionLocal {
    struct Service {
        uint256 serviceId;
        string location;
        uint256 cost;
    }

    struct Provider {
        address providerAddress;
        Service[] services;
    }

    struct Selection {
        address consumer;
        address provider;
        uint256 serviceId;
    }

    Provider[] public providers;
    mapping(address => uint256) public providerIndex;
    Selection[] public selections;

    event ServiceAdded(address indexed provider, uint256 serviceId, string location, uint256 cost);
    event ServiceSelected(address indexed consumer, address indexed provider, uint256 serviceId);

    function addService(uint256 serviceId, string memory location, uint256 cost) public {
        uint256 index = providerIndex[msg.sender];
        if (index == 0) {
            providers.push();
            index = providers.length;
            providers[index - 1].providerAddress = msg.sender;
            providerIndex[msg.sender] = index;
        }

        providers[index - 1].services.push(Service(serviceId, location, cost));
        emit ServiceAdded(msg.sender, serviceId, location, cost);
    }

    function getProviders() public view returns (Provider[] memory) {
        return providers;
    }

    function getProviderServices(address provider) public view returns (Service[] memory) {
        uint256 index = providerIndex[provider];
        require(index > 0, "Provider not found");
        return providers[index - 1].services;
    }

    function selectService(address provider, uint256 serviceId) public {
        uint256 index = providerIndex[provider];
        require(index > 0, "Provider not found");

        Service[] memory services = providers[index - 1].services;
        bool serviceFound = false;
        for (uint256 i = 0; i < services.length; i++) {
            if (services[i].serviceId == serviceId) {
                serviceFound = true;
                break;
            }
        }
        require(serviceFound, "Service not found");

        selections.push(Selection(msg.sender, provider, serviceId));
        emit ServiceSelected(msg.sender, provider, serviceId);
    }

    function getSelections() public view returns (Selection[] memory) {
        return selections;
    }
}

